import './AuthButtons.css';

import { useSelector } from 'react-redux'
import { AppState } from '../../state/reducers/root'

function AuthButtons() {
    const isAuthenticated = useSelector((state: AppState) => state).authentication.isAuthenticated

    return (
        <div>
            <button className="auth-button auth-login-button">

            </button>

            <button className="auth-button auth-logout-button">

            </button>
        </div>
    )
}

export default AuthButtons
